import React from 'react'
import './Items.css'

const Items = (props) => {
  return (
    <div className='items'>
        <img src={props.image} alt=""/>
        <p>{props.name}</p>
        <div className="items-price">
            <div className="discounted-price">
                {props.discounted_price}
            </div>
            <div className="original-price">
                {props.original_price}
            </div>
        </div>

    </div>
  )
}

export default Items
